import tkinter as tk
from tkinter import filedialog
import webbrowser
import svgwrite
import base64
import re

# ------------------------------------------------
# Base64-encoded image data
# (Replace this with the Base64 string for your image.)
# ------------------------------------------------
EXAMPLE_IMAGE_B64 = """

"""

def get_example_image():
    """
    Decode the Base64 string and create a Tkinter PhotoImage.
    Replace EXAMPLE_IMAGE_B64 with your own image data if desired.
    """
    raw_b64 = "".join(EXAMPLE_IMAGE_B64.split())
    image_data = base64.b64decode(raw_b64)
    return tk.PhotoImage(data=image_data)

# ------------------------------------------------
# Configuration
# ------------------------------------------------
TAPE_HEIGHT = 1.0
HORIZONTAL_MARGIN = 0.25
COLUMN_SPACING = 0.1
DATA_HOLE_DIAM = 0.072
SPROCKET_HOLE_DIAM = 0.046
MAX_TAPE_LENGTH_IN = 16.0

vertical_positions = [
    0.1,  # bit7
    0.2,  # bit6
    0.3,  # bit5
    0.4,  # bit4
    0.5,  # bit3
    0.6,  # sprocket
    0.7,  # bit2
    0.8,  # bit1
    0.9,  # bit0
]

bit_index_map = {
    7: 0,
    6: 1,
    5: 2,
    4: 3,
    3: 4,
    2: 6,
    1: 7,
    0: 8,
}
SPROCKET_IDX = 5  # index for sprocket hole

# ------------------------------------------------
# Step 1: Split text into segments
# ------------------------------------------------
def split_text_into_segments(full_text):
    usable_width = MAX_TAPE_LENGTH_IN - 2 * HORIZONTAL_MARGIN
    max_chars = int(usable_width / COLUMN_SPACING)
    if max_chars < 1:
        raise ValueError("No room for even 1 character with these margins/spacings!")

    segments = []
    start_idx = 0
    total_chars = len(full_text)
    while start_idx < total_chars:
        end_idx = start_idx + max_chars
        chunk = full_text[start_idx:end_idx]
        if not chunk:
            break
        segments.append(chunk)
        start_idx = end_idx
    return segments

# ------------------------------------------------
# Step 2: Compute segment width in inches
# ------------------------------------------------
def compute_segment_width_in(chunk_text):
    num_chars = len(chunk_text)
    return 2 * HORIZONTAL_MARGIN + num_chars * COLUMN_SPACING

# ------------------------------------------------
# Step 3: Draw holes for one segment at a given y_offset
# ------------------------------------------------
def draw_segment(dwg, text_segment, y_offset):
    ascii_codes = [ord(ch) for ch in text_segment]
    for i, code in enumerate(ascii_codes):
        x_center = HORIZONTAL_MARGIN + i * COLUMN_SPACING

        # Sprocket hole
        sprocket_y = y_offset + vertical_positions[SPROCKET_IDX]
        dwg.add(dwg.circle(
            center=(f"{x_center}in", f"{sprocket_y}in"),
            r=f"{SPROCKET_HOLE_DIAM/2}in",
            fill='none',
            stroke='red',
            stroke_width="0.1mm"
        ))

        # Data holes for bits
        for bit_i in range(8):
            bit_val = (code >> bit_i) & 1
            if bit_val == 1:
                local_y = y_offset + vertical_positions[bit_index_map[bit_i]]
                dwg.add(dwg.circle(
                    center=(f"{x_center}in", f"{local_y}in"),
                    r=f"{DATA_HOLE_DIAM/2}in",
                    fill='none',
                    stroke='red',
                    stroke_width="0.1mm"
                ))

# ------------------------------------------------
# Step 4: Generate SVG with stacked segments
# ------------------------------------------------
def generate_single_svg_stacked_segments(full_text, filename, log_callback=None):
    segments = split_text_into_segments(full_text)
    num_segments = len(segments)

    total_height_in = num_segments * TAPE_HEIGHT
    widths = [compute_segment_width_in(seg) for seg in segments]
    total_width_in = max(widths) if widths else 0.0

    if log_callback:
        log_callback(f"Creating single SVG with {num_segments} vertical segments.")
        log_callback(f"Total size: {total_width_in:.2f}\" wide x {total_height_in:.2f}\" tall")
        log_callback(f"Saving to: {filename}")

    dwg = svgwrite.Drawing(
        filename=filename,
        size=(f"{total_width_in}in", f"{total_height_in}in"),
        profile='tiny'
    )

    for idx, segment_text in enumerate(segments):
        y_offset = idx * TAPE_HEIGHT
        seg_w = compute_segment_width_in(segment_text)

        # Optional: outline rectangle for each segment
        dwg.add(dwg.rect(
            insert=(f"0in", f"{y_offset}in"),
            size=(f"{seg_w}in", f"{TAPE_HEIGHT}in"),
            fill='none',
            stroke='black',
            stroke_width="0.1mm"
        ))

        draw_segment(dwg, segment_text, y_offset)

        # Label each segment
        tape_label = f"Tape #{idx+1} (chars={len(segment_text)})"
        dwg.add(dwg.text(
            tape_label,
            insert=(f"0.05in", f"{y_offset + 0.05}in"),
            fill='none',
            stroke='blue',
            stroke_width="0.020mm",
            font_size="0.05in"
        ))

    dwg.save()

    if log_callback:
        log_callback("Done.\n")

# ------------------------------------------------
# Control-Code Parsing & Highlighting
# ------------------------------------------------
CONTROL_CODE_PATTERN = re.compile(r'<0x([0-9A-Fa-f]{2})>')

def parse_control_codes(user_text):
    """
    Scan user_text for tokens of the form <0xNN>.
    If NN is a valid control range (0x00..0x1F or 0x7F),
    replace with the actual ASCII control character.
    Otherwise, leave it literal.
    Returns the processed text.
    """

    def replace_code(match):
        hex_str = match.group(1)  # e.g. '07'
        val = int(hex_str, 16)
        # Check if it's in control range
        if (0 <= val <= 31) or (val == 127):
            return chr(val)  # Replace with actual control char
        else:
            # Not a recognized control code -> keep original <0xNN>
            return match.group(0)

    return CONTROL_CODE_PATTERN.sub(replace_code, user_text)

def highlight_control_codes(text_widget):
    """
    Highlights all <0xNN> tokens in the text widget
    that might represent control codes. We'll apply a background color.
    """
    # Remove any existing tags
    text_widget.tag_remove("ctrlcode", "1.0", "end")

    # Define how the tag looks
    text_widget.tag_config("ctrlcode", background="khaki", foreground="black")

    pattern_str = r"<0x[0-9A-Fa-f]{2}>"  # 6 chars total
    idx_start = "1.0"

    while True:
        # Search for pattern
        pos = text_widget.search(pattern_str, idx_start, stopindex="end", regexp=True)
        if not pos:
            break  # no more matches

        # Each match is exactly 6 characters: <0xNN>
        match_len = 6
        # Tag this region
        start_idx = pos
        end_idx = f"{pos}+{match_len}c"  # c means "characters"

        text_widget.tag_add("ctrlcode", start_idx, end_idx)

        # Advance idx_start beyond this match
        idx_start = end_idx


def index_to_offset(text_content, tk_index):
    """
    Convert a Tkinter text index like "3.5" to a zero-based offset
    into text_content. "3.5" means row=3, column=5 in that line.
    We need to sum the lengths of previous lines, plus the column.
    """
    lines = text_content.split("\n")  # splitted by lines
    row_str, col_str = tk_index.split(".")
    row = int(row_str) - 1  # 1-based to 0-based
    col = int(col_str)
    offset = 0
    for i in range(row):
        offset += len(lines[i]) + 1  # +1 for the newline
    offset += col
    return offset


# ------------------------------------------------
# TKINTER GUI
# ------------------------------------------------
def main_gui():
    root = tk.Tk()
    root.title("8-Bit ASCII2PaperTape SVG Generator")

    # === Info Frame at top ===
    info_frame = tk.Frame(root)
    info_frame.pack(fill='x', padx=10, pady=10)

    title_label = tk.Label(info_frame, text="8-Bit ASCII to Paper Tape Generator",
                           font=("Helvetica", 14, "bold"))
    title_label.pack(anchor='w', pady=(0,5))

    desc_label = tk.Label(
        info_frame,
        text=(
            "This tool takes ASCII text and generates an SVG of 1-inch 8-bit paper tape with sprocket hole.\n"
            "Extended ASCII is supported. Enter normal text or control codes in the format <0xNN> (e.g. <0x07> = BEL)."
        ),
        justify="left",  # Align text to the left
        anchor="w"  # Anchor the text to the west (left)
    )
    desc_label.pack(anchor='w', pady=(0, 2))


    # Additional text: your name, clickable website link
    author_label = tk.Label(info_frame, text="Author: Joshua Coleman")
    author_label.pack(anchor='w', pady=(2,0))

    def open_website(event):
        webbrowser.open_new_tab("https://joshuacolemanmakes.wordpress.com/")

    website_label = tk.Label(
        info_frame,
        text="https://joshuacolemanmakes.wordpress.com/",
        fg="#1E90FF",
        cursor="hand2",
        font=("Helvetica", 10, "underline")
    )
    website_label.pack(anchor='w', pady=(0,5))
    website_label.bind("<Button-1>", open_website)

    # === Add embedded image (Base64) ===
    example_img = get_example_image()
    img_label = tk.Label(info_frame, image=example_img)
    img_label.pack(anchor='w', pady=(5,10))
    img_label.img_ref = example_img  # prevent garbage collection
    # Label above the text entry field
    ascii_label = tk.Label(root, text="Type or Copy/Paste ASCII (with optional <0xNN> control codes):",
                        font=("Helvetica", 12))
    ascii_label.pack(anchor='w', padx=10, pady=(0, 2))

    # Add a clickable link to the ASCII control code website
    def open_ascii_website(event):
        webbrowser.open_new_tab("https://www.ascii-code.com/")

    ascii_link = tk.Label(
        root,
        text="Click here for a reference of ASCII control codes",
        fg="#1E90FF",  # Blue color for links
        cursor="hand2",  # Hand cursor on hover
        font=("Helvetica", 10, "underline")
    )
    ascii_link.pack(anchor='w', padx=10, pady=(0, 10))

    # Bind the link to open the website
    ascii_link.bind("<Button-1>", open_ascii_website)

    # === Text Frame (fixed width in chars) ===
    text_frame = tk.Frame(root)
    text_frame.pack(padx=10, pady=(0,5))
    text_frame.pack_propagate(False)

    scrollbar = tk.Scrollbar(text_frame, orient=tk.VERTICAL)
    scrollbar.pack(side='right', fill='y')

    text_box = tk.Text(text_frame, wrap='char', width=80, height=24,
                       yscrollcommand=scrollbar.set)
    text_box.pack(side='left')
    scrollbar.config(command=text_box.yview)
    text_frame.configure(width=640, height=400)

    # === Control Frame for radio buttons, etc. ===
    control_frame = tk.Frame(root)
    control_frame.pack(fill='x', padx=10, pady=10)

    # -- Column wrap selection
    column_label = tk.Label(
        control_frame,
        text="Select 40 or 80 columns (display width only):",
        font=("Helvetica", 10)
    )
    column_label.grid(row=0, column=0, columnspan=2, sticky='w', pady=(0,5))

    wrap_var = tk.IntVar(value=80)  # default to 80

    rb_40 = tk.Radiobutton(control_frame, text="40 cols", variable=wrap_var,
                           value=40)
    rb_40.grid(row=1, column=0, sticky='w')

    rb_80 = tk.Radiobutton(control_frame, text="80 cols", variable=wrap_var,
                           value=80)
    rb_80.grid(row=1, column=1, sticky='w', padx=(10,0))

    def update_wrap():
        new_width = wrap_var.get()
        text_box.config(width=new_width)

    rb_40.config(command=update_wrap)
    rb_80.config(command=update_wrap)

    # -- Line ending selection
    line_ending_label = tk.Label(
        control_frame,
        text="Choose line endings:",
        font=("Helvetica", 10)
    )
    line_ending_label.grid(row=2, column=0, columnspan=2, sticky='w', pady=(10,5))

    line_ending_var = tk.StringVar(value='LF')  # default LF
    rb_lf = tk.Radiobutton(control_frame, text="LF (\\n)", variable=line_ending_var, value='LF')
    rb_lf.grid(row=3, column=0, sticky='w')

    rb_crlf = tk.Radiobutton(control_frame, text="CR+LF (\\r\\n)", variable=line_ending_var, value='CRLF')
    rb_crlf.grid(row=3, column=1, sticky='w', padx=(10,0))

    # === Console Frame (for log output) ===
    console_frame = tk.Frame(root)
    console_frame.pack(fill='both', expand=True, padx=10, pady=(0,10))

    console_label = tk.Label(console_frame, text="Status Log", font=("Helvetica", 12, "bold"))
    console_label.pack(anchor='w', pady=(0,5))

    console_scroll = tk.Scrollbar(console_frame, orient=tk.VERTICAL)
    console_scroll.pack(side='right', fill='y')

    console_box = tk.Text(console_frame, wrap='word', height=8,
                          yscrollcommand=console_scroll.set)
    console_box.pack(side='left', fill='both', expand=True)
    console_scroll.config(command=console_box.yview)
    console_box.config(state='disabled')

    def log_message(msg):
        console_box.config(state='normal')
        console_box.insert('end', msg + '\n')
        console_box.see('end')
        console_box.config(state='disabled')

    def on_generate():
        # 1) Grab text
        user_text = text_box.get("1.0", tk.END)
        if not user_text.strip():
            return

        # 2) Convert line endings if needed
        if line_ending_var.get() == 'CRLF':
            user_text = user_text.replace('\n', '\r\n')

        # 3) Parse control codes: <0xNN> => ASCII control char (if valid)
        parsed_text = parse_control_codes(user_text)

        # 4) Ask user for output file
        file_path = filedialog.asksaveasfilename(
            defaultextension=".svg",
            filetypes=[("SVG Files", "*.svg"), ("All Files", "*.*")]
        )
        if not file_path:
            return

        # 5) Generate the SVG with the parsed text
        generate_single_svg_stacked_segments(parsed_text, file_path, log_callback=log_message)

        # 6) Highlight recognized control code tokens in the text box
        highlight_control_codes(text_box)
        log_message("Control codes (if any) have been highlighted in the text box.\n")

    generate_btn = tk.Button(control_frame, text="Generate SVG", command=on_generate)
    generate_btn.grid(row=4, column=0, columnspan=2, sticky='e', pady=(10,0))

    root.mainloop()

if __name__ == "__main__":
    main_gui()
